import React from "react";

const Dashboard = () => {
  return (
    <div className="flex items-center justify-center h-screen bg-gray-100">
      <h2 className="text-3xl font-bold">Welcome to Cognivive Dashboard</h2>
    </div>
  );
};

export default Dashboard;
